import React from "react";
import Typewriter from "typewriter-effect";
import "./home.css";
import { motion } from "framer-motion";
import { useState } from "react";

function Home() {
  const [heading, setheading] = useState(true);
  setInterval(() => {
    setheading(false);
  }, 4000);
  return (
    <div className="container1">
      <AnimatePresence>
        <motion.h1
          initial={{ color: "black", opacity: 0 }}
          animate={{ color: "white", scale: "1.3", y: -210, opacity: 1 }}
          transition={{
            delay: 2,
            duration: 1.5,
            type: "spring",
            stiffness: 80,
          }}
        >
          Hello Everyone I am Anish Kumar Singh
        </motion.h1>
      </AnimatePresence>
      <h2>I'm a </h2>
      <div className="typer">
        <Typewriter
          onInit={(typewriter) => {
            typewriter
              .pauseFor(2000)
              .typeString("Learner")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Programmer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Data Structures Enthusiast")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .start();
          }}
        />
      </div>
    </div>
  );
}

export default Home;
